// Screen.component.js
import React from 'react';
import './screen.styles.css';

const Screen = ({ emails }) => {
  return (
    <div className="screen-container">
      <div className="rectangle" id="leftRectangle"></div>
      <div className="rectangle" id="innerRectangle1"></div>
      <div className="rectangle" id="emailSidebar">
        <h1 className="heading">Email Sidebar View</h1>
        <div className="email-list">
          {emails.map((email) => (
            <div key={email.id} className="email-item">
              <div className="email-info">
                <div className="email-from">{email.from}</div>
                <div className="email-subject">{email.subject}</div>
                <div className="email-address">{email.address}</div>
                <div className="email-timestamp">{email.timestamp}</div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <div className="rectangle" id="innerRectangle2"></div>
      <div className="rectangle" id="emailBody">
        <h1 className="heading">Email Body View</h1>
      </div>
    </div>
  );
};

export default Screen;
